import React, { useState } from "react"
function Form(){   
    const [login,setlogin]=useState(false)
    let element;
    if(login){
       element= <h1>successfully</h1>
    }else{
      element = <h2>Not successfully</h2>
    }
    function Toggle(){
        setlogin(true)
    }
    return(
        <>
        {element}
    <button onClick={Toggle}>Login</button>
    </>
    )
}
export default Form
